    dated December 23, 2010, we have amended the report to include the missing dates.
    \ In reference to the 48 hour notices, it appears that there was an error in reporting
    the dates for the 48 hour notices of 10/21/2010 and 10/19/2010.  After review
    of the records, the 48 hour notice for 10/19/2010 was filed twice rather than
    the 10/21/2010 48 hour notice being filed.  We have reviewed our procedures for
    filing in the future and will implement a new procedure for double checking the
    filed 48 hour notice reports daily.\n"
